import React, { useEffect, useState } from "react";
import "../pages/FavoritePage.css";
import { Link } from "react-router-dom";
import Header from "./Header";
import Footer from "./Footer";

interface Favorite {
  id: number;
  user_id: number;
  store_id: number;
  store_name: string;
  store_address: string;
  store_URL: string;
  store_img: string;
  store_type: number;
}

interface Review {
  id: number;
  store_id: number;
  rating: number;
  comment: string;
}


const FavoritePage: React.FC = () => {
  const [favorites, setFavorites] = useState<Favorite[]>([]);
  const [reviews, setReviews] = useState<Review[]>([]);

  useEffect(() => {
    const fetchFavorites = async () => {
      try {
        const response = await fetch("http://localhost:5003/favorites/1", {
          method: "GET",
          credentials: "include",
          headers: { "Content-Type": "application/json" },
        });

        if (!response.ok) {
          throw new Error("エラーが返されました");
        }

        const data: Favorite[] = await response.json();
        console.log("取得したお気に入りリスト:", data);
        setFavorites(data);
      } catch (error) {
        console.error(error);
      }
    };

    fetchFavorites();
  }, []);

  useEffect(() => {
    const fetchReviews = async () => {
      try {
        const response = await fetch("http://localhost:5003/reviews", {
          method: "GET",
          headers: { "Content-Type": "application/json" },
        });

        if (!response.ok) {
          throw new Error("口コミデータの取得に失敗しました");
        }

        const data: Review[] = await response.json();
        setReviews(data);
      } catch (error) {
        console.error(error);
      }
    };

    fetchReviews();
  }, []);
  const dogruns = favorites.filter((fav) => fav.store_type === 1);
  const dogcafes = favorites.filter((fav) => fav.store_type === 2);
  const petshops = favorites.filter((fav) => fav.store_type === 3);
  const hospitals = favorites.filter((fav) => fav.store_type === 4);

  console.log("🐶 ドッグラン:", dogruns);
  console.log("☕ ドッグカフェ:", dogcafes);
  console.log("🛍️ ペットショップ:", petshops);
  console.log("🏥 動物病院:", hospitals);

  // 店舗の種類に応じたページの遷移先を取得
  const getCategoryPath = (storeType: number, storeId: number) => {
    switch (storeType) {
      case 1:
        return `/dogrun/detail/${storeId}`;
      case 2:
        return `/dogcafe/detail/${storeId}`;
      case 3:
        return `/petshop/detail/${storeId}`;
      case 4:
        return `/hospital/detail/${storeId}`;
      default:
        return `/detail/${storeId}`;
    }
  };
  // カテゴリーごとに表示する関数
  const renderCategory = (storeType: number, title: string) => {
    const items = favorites.filter((fav) => fav.store_type === storeType);

    return (
      <section key={storeType}>
        <h2 className="category-title">{title}</h2>
        {items.length > 0 ? (
          <ul className="favorite-list">
            {items.map((favorite) => {
              // 対象商品の口コミデータを取得
              const storeReviews = reviews.filter(
                (review) => review.store_id === favorite.store_id
              );

              // 平均評価を計算（口コミがある場合のとき）
              const averageRating =
                storeReviews.length > 0
                  ? storeReviews.reduce(
                    (sum, review) => sum + review.rating,
                    0
                  ) / storeReviews.length
                  : 0;

              return (
                <Link
                  to={getCategoryPath(favorite.store_type, favorite.store_id)}
                  className="favorite-link"
                  key={favorite.store_id}
                >
                  <li className="favorite-item">
                    <img
                      src={
                        favorite.store_img
                          ? favorite.store_img
                          : "https://via.placeholder.com/150"
                      }
                      alt={favorite.store_name}
                      className="favorite-image"
                    />
                    <h2 className="favorite-title">{favorite.store_name}</h2>
                    <div className="review-average">
                      {[1, 2, 3, 4, 5].map((value) => (
                        <span
                          key={`star-${favorite.store_id}-${value}`}
                          className={`star ${value <= Math.round(averageRating) ? "selected" : ""
                            }`}
                        >
                          ★
                        </span>
                      ))}
                      <strong>{averageRating.toFixed(1)}</strong>
                    </div>
                  </li>
                </Link>
              );
            })}
          </ul>
        ) : (
          <p className="no-favorites">
            このカテゴリーにお気に入りはまだ登録されていません。
          </p>
        )}
      </section>
    );
  };

  return (
    <>
      <Header />
      <div className="favorite-container">
        <header className="app-header">
          <h1 className="title">お気に入りリスト</h1>
        </header>

        {renderCategory(1, "ドッグラン")}
        {renderCategory(2, "ドッグカフェ")}
        {renderCategory(3, "ペットショップ")}
        {renderCategory(4, "動物病院")}
      </div>
      <Footer />
    </>
  );
};
export default FavoritePage;
